    """ 思路一: **栈模拟** """
    def replaceNonCoprimes(self, nums: List[int]) -> List[int]:
        def compute_gcd(x, y):
            # print(f"GCD: {x,y}")
            while(y):
                x, y = y, x % y
            return x

        s = [nums[0]]
        for num in nums[1:]:
            s.append(num)
            while len(s)>1:
                x,y = s[-1], s[-2]
                # g = math.gcd(x,y)
                g = compute_gcd(x,y)
                if g==1:
                    break
                s.pop()
                s[-1] *= x//g
        return s

